export default {
  // 更新 marketings
  marketings(state, data) {
    switch (data.type) {
      case 'init':
        state.marketings = data.data
        break
      case 'concat':
        state.marketings.concat(data.data)
        break
      case 'delete':
        state.marketings.splice(data.index, 1)
        break
      default:
      // nothing
    }
  },
  // 设置缓存营销网页
  setCache(state, data) {
    state.cache = data
  }
}
